import cv2
from requests_html import HTMLSession

multipart = {
    "imageBin": (
        "temp.png",
        cv2.imencode(
            ".png",
            "",
        )[1],
    )
}

session = HTMLSession()

r = session.post(
    "https://bing.com//images/search?view=detailv2&iss=sbiupload&FORM=SBIHMP&sbisrc=ImgPicker&idpbck=1",
    files=multipart,
)

r.html.render(timeout=4.0)
search_html = r.html
r.close()
print(search_html)
